import { NavLink } from "react-router-dom";
import { Link } from "react-router-dom";

function Navbar(){
    return (
        <div className = 'navbar'>
            <div>
                <ul classname='navbar-menu'>
                    <li><Link to ="/About">About Me</Link></li>
                </ul>
            </div>
        </div>
    )
}
